import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { render } from "react-dom";
import "./styles.css";
import { initFacebookSdk } from "./helpers";
initFacebookSdk().then(startApp);

function startApp() {
  render(<App />, document.querySelector("#root"));
}
